import { Routes, Route, Navigate } from "react-router-dom";
import React from "react";

import Home from "/home/joshua/finals-homeworks/guided-capstone-project-starter-code/guided-capstone-project/src/pages/Home/Home.js"

function AppRoute() {
    return(
        <Routes>
        <Route
          path="/"
          element={<Home />}
        />

        <Route
          path="/spacecrafts"
          element={<Spacecrafts />}
        />
        <Route
          path="/spacecraft/build"
          element={<SpacecraftBuild />}
        />
        <Route
          path="/spacecraft/:id"
          element={<Spacecraft />}
        />

        <Route
          path="/planets"
          element={<Planets />}
        />

        <Route
          path="*"
          element={<Navigate to={"/"} />}
        />
      </Routes>
    )
}

export default Character;
